      "Chef's Spicy Noodle Soup (Soft Noodle)": [{
        "spicy": "1",
        "english": "Chicken Noodle Soup",
        "chinese": "lazy",
        "price": "10.25"
      }],
      "Fried Rice": [{
        "spicy": "1",
        "english": "Vegetable Fried Rice (curry style)",
        "chinese": "lazy",
        "price": "9.75"
      }, {
        "spicy": "0",
        "english": "Chicken Fried Rice",
        "chinese": "lazy",
        "price": "9.95"
      }]
    }]
  }
  return (
    <div className="App">
      <Menu/>
      <Order/>
    </div>
  );
}

export default App;
